const SERVICE_BASE_URL =
  'https://www.atg.se/services/racinginfo/v1/api/products/'
const ALLOWED_INPUTS = ['V75', 'V65', 'V64', 'V4']

export const getGames = gameType => ({
  betType: 'V75',
  upcoming: [
    {
      id: 'V75_2019-03-16_22_5',
      startTime: '2019-03-16T16:20:00',
      tracks: [{ id: 22, name: 'Mantorp' }],
      favorites: [
        {
          raceId: '2019-03-16_22_5',
          legNumber: 1,
          start: { number: 2, name: 'Harran Boko', distribution: 4800 }
        },
        {
          raceId: '2019-03-16_22_6',
          legNumber: 2,
          start: { number: 8, name: 'Estelle Brodda', distribution: 4400 }
        },
        {
          raceId: '2019-03-16_22_8',
          legNumber: 4,
          start: { number: 1, name: 'Global Viscount', distribution: 2200 }
        }
      ],
      addOns: ['boost']
    }
  ],
  results: [
    {
      id: 'V75_2019-03-09_15_5',
      tracks: [{ id: 15, name: 'F채rjestad' }],
      totalToWin: 5229577000,
      startTime: '2019-03-09T16:21:20',
      addOns: ['boost']
    },
    {
      id: 'V75_2019-03-03_14_5',
      tracks: [{ id: 14, name: 'Eskilstuna' }],
      totalToWin: 1465413000,
      startTime: '2019-03-03T14:30:06',
      addOns: ['boost']
    },
    {
      id: 'V75_2019-03-02_18_5',
      tracks: [{ id: 18, name: 'Halmstad' }],
      totalToWin: 5354228700,
      startTime: '2019-03-02T16:20:21',
      addOns: ['boost']
    },
    {
      id: 'V75_2019-02-23_9_5',
      tracks: [{ id: 9, name: 'Bergs책ker' }],
      totalToWin: 5161449500,
      startTime: '2019-02-23T16:20:35',
      addOns: ['boost']
    },
    {
      id: 'V75_2019-02-16_8_5',
      tracks: [{ id: 8, name: 'Axevalla' }],
      totalToWin: 5223894200,
